La série harmonique est composée de toutes les fractions dont la somme des termes est égale à 1. La série harmonique se présente sous la forme :
{2, 4, 6, 8, ...}
En utilisant le concept de fractions dans les nombres rationnels, nous pouvons montrer que la série harmonique est équicorps si et seulement si les fractions ont le même coefficient. Par exemple, si les fractions sont toutes des carrés et que nous savons que la somme des termes est égale à 3 (si le cube de chaque nombre est 1), alors nous avons la série harmonique suivante :
{1/2, 1/4, 1/8, 1/16 + 1/36, ...}
Le cube d'un nombre est constant, ce qui signifie que nous avons le même nombre de fractions que le nombre de multiples. Par conséquent, le nombre de carrés qui composent la série harmonique est égal au même nombre que la somme des multiples. La série harmonique a exactement la même série de carrés que la somme des multiples, ce qui confirme l'équicorps sur la forme graphique.
